import React from 'react';
import Header from './components/Header';
import HeroSection from './components/HeroSection';
import BlogSection from './components/BlogSection';
import Footer from './components/Footer';
import './App.css';

function App() {
    return (
        <div className="app">
            <Header />
            <main>
                <HeroSection />
                <BlogSection />
            </main>
            <Footer />
        </div>
    );
}

export default App;
